    fetch('http://localhost:8080/JobVista/PanelistOpeningServlet', {
      method: 'POST',
      headers: {
          'Content-type': 'application/json'
      },
      body: JSON.stringify({ 'userDetails': JSON.parse(localStorage.getItem('userDetails')) })
  })
      .then((response) => {
          if (!response.ok) {
              throw new Error(`HTTP error status: ${response.status}`)
          }

          return response.json();
      })
      .then((result) => {
          console.log("opening", result)
          setOpeningName(result.Value.openings.description);
          setOpeningsJson(result.Value.openings);

      })
      .catch((error) => {
          console.log("Error in get openings ", error);
      })
  }
  return (
    <div id={Style.mainProfile}>
      <h1 id={Style.name}></h1>
      <p id={Style.email}></p>
      <p id={Style.gender}></p>
      <p id={Style.role}></p>
      <p id={Style.position}></p>
    </div>
  )
}
